local DStory = {
  [1] = {id=1,name="1",text="يا جوستين بلغ موقعك الآن!"},
  [2] = {id=2,name="Justin",text="يا رئيس {1} قد دخل فريق الاكتشاف إلى مكان برج الحمل استعدادا لهبوط إلى a! كوكب برج الحمل للاكتشاف!"},
  [3] = {id=3,name="1",text="تستهدف هذه الرحلة إلى اكتشاف الطاقة الجديدة المجهولة، أهم شيء هو الأمن يجب اخلاء في اسرع وقت ممكن عند مواجهة الخواطر."},
  [4] = {id=4,name="Justin",text="عرفت، يا رئيس {1}، سنكمل المهمة ونكشف طاقة الكوكب المفيدة سهلا!"},
  [5] = {id=5,name="Chuck Li",text="يا جوستين استعدت السفينة الفضائية لهبوط يمكن هبوط في أي وقت!"},
  [6] = {id=6,name="Justin",text="حسنا، استعد لهبوط إلى كوكب برج الحمل α!"},
  [7] = {id=7,name="Justin",text="لم أكن أتوقع اثني عشر مجرة البروج جود لها في الواقع غير معروف البيولوجية، نوكس، وكيف خسارة السفينة ؟"},
  [8] = {id=8,name="Noak",text="الحمد لله أدركنا في أسرع وقت ممكن لم يؤدي إلى استهلاك بشكل كبير يمكن استمرار في كشف."},
  [9] = {id=9,name="Justin",text="طيب، استعدوا لحرب بدرجة أولي يبدو أن رحلة الكوكب هذه صعبة جدا."},
  [10] = {id=10,name="Miguchi Chiko",text="جوستين، والجبهة هي الكواكب الحمل b، رؤية UFO، ونحن ما زلنا على الجدول الزمني لتسجيل ذلك؟"},
  [11] = {id=11,name="Justin",text="هل يمكنك أن تواصل معهم لمعرفة من هم؟"},
  [12] = {id=12,name="Miguchi Chiko",text="نحاول تواصل معهم."},
  [13] = {id=13,name="Chuck Li",text="حسنا، هناك هجوم العدو، وهذه المرة قبل أن هبطت عليه، والآخر لإطلاق الهجوم الخاص بك!"},
  [14] = {id=14,name="Justin",text="لا تذعر استعد للحرب."},
  [15] = {id=15,name="Christina",text="جاستن، ألقينا القبض على سفينة حربية للعدو، والسائق في الواقع أجنبي على متن السفينة."},
  [16] = {id=16,name="Justin",text="هل هو كائن معروف خارج الأرض؟"},
  [17] = {id=17,name="Christina",text="لا، كائن غير معروف أجنبي، ولكن أيضا من وجهة نظر لدرجة السفن الحربية ون مينغ، أفضل من يعرف كائن أجنبي."},
  [18] = {id=18,name="Justin",text="يبدو أن الأشاعة حقيقة هناك كوائن قوية في 12 مجرة مسير الشمس، علينا أن ننتبه بها."},
  [19] = {id=19,name="Chuck Li",text="الحمل c هو أمام هذا الكوكب، وهو القطع الرئيسية من الكواكب، قد يكون معقل الغريبة هنا."},
  [20] = {id=20,name="Justin",text="اخبر الجميع تحدير إلى الأمام ببطء، استعدوا في أي وقت."},
  [21] = {id=21,name="Miguchi Chiko",text="جاستن، قادة الكوائن الحي الخارجي طلب منا أن يتحدث معنا وجه لوجه."},
  [22] = {id=22,name="Justin",text="غير المتوقع أن طلبهم محادثة معنا؟ هم خائفين من هجومنا؟"},
  [23] = {id=23,name="Chuck Li",text="ربما هو مؤامرة العدو معدل الذكاء للكوائن مرتفع جدا."},
  [24] = {id=24,name="Justin",text="في اي حال؟ الحديث اولا، إذا كان الطرف الآخر ليس عدائيا، والتعايش السلمي هو الأفضل."},
  [25] = {id=25,name="Miguchi Chiko",text="تمام أرد عليهم لتحديد موعد المحادثة."},
  [26] = {id=26,name="Justin",text="توموكو، هل تحدد اليوم موعد الحوار مع الجانب الآخر وجها لوجه الحوار في الحمل الكوكب d؟"},
  [27] = {id=27,name="Miguchi Chiko",text="نعم، هو اليوم."},
  [28] = {id=28,name="Justin",text="لماذا لم يظهرون حتي الآن؟ هناك مؤامرة؟"},
  [29] = {id=29,name="Chuck Li",text="يبدو أن ليس صحيحا، نقوم بإخلاء مقدما."},
  [30] = {id=30,name="Miguchi Chiko",text="يبدو أن ليس لدينا وقتا ، ظهرت سفينة العدو."},
  [31] = {id=31,name="Justin",text="من أنتم؟ لستم من خارج الأرض."},
  [32] = {id=32,name="Jack",text="قيل أن سخيفة حقا أنك سخيفة. ما أجنبي، وكنت الكابتن جاك الشهير."},
  [33] = {id=33,name="Justin",text="تبين أن القراصنة بين النجوم، هل تريد من هنا لتسلب منا."},
  [34] = {id=34,name="Jack",text="أتي إلى هنا لافادة بكم ألا أي أحد يأتي إلى 12برجا في مجرة مسير الشمس لو تعرفه امشي بعيدا."},
  [35] = {id=35,name="Justin",text="القراصنة المطبوب في كل مكان في الفضاء، لماذا التهديد والوعيد، واصطف سفن حربية فوق."},
  [36] = {id=36,name="Justin",text="حسنا، في المرة الأخيرة يجري الافتراض جاك الهروب، القراصنة الصغيرة بين النجوم ، لماذا هناك الكثير من الثقة؟"},
  [37] = {id=37,name="Chuck Li",text="القراصنة لم الربح لا يستطيعون في وقت مبكر، يبدو أن هناك متأكد من أن هناك العديد من الموارد الغنية."},
  [38] = {id=38,name="Justin",text="أفكر ذلك أيضا استمر في البحث في برج الحمل."},
  [39] = {id=39,name="Justin",text="رأيك رأي استمر في كشف كوكب برج الحمل."},
  [40] = {id=40,name="Alice",text="لماذا تهجم علينا؟ هل أنتم صديق رئيس السفينة جاك؟"},
  [41] = {id=41,name="Miguchi Chiko",text="يا متطفلين ، هذا مكان كوكب برج الحمل الذي لا يمكن دخول إليها المرء."},
  [42] = {id=42,name="Alice",text="حقا أن هذه المرة كوائن خارج الأرض تطابق مع سفينة خارج الأرض التي اعتقلناها المرة السابقة."},
  [43] = {id=43,name="Justin",text="ابتعد عن كوكبنا ، وإلا نهجم عليكم."},
  [44] = {id=44,name="Alice",text="أنتم كذابون باسم التعايش السلمي، في الواقع، لنهب مواردنا."},
  [45] = {id=45,name="Justin",text="يمكننا مقايضة اتفاق سلام، يمكن أن نتحدث."},
  [46] = {id=46,name="Alice",text="أنتم بالتأكيد القراصنة بين النجوم وأولئك الذين هم مجموعة، لا تعتقد أن يخدعنا، تخضع للذهاب يموت."},
  [47] = {id=47,name="Justin",text="ترى، نحن في الحقيقة ليست تلك القراصنة بين النجوم، فهم المجرمين المطلوبين، فإننا قبض عليهم."},
  [48] = {id=48,name="Alice",text="هل حقا لا القراصنة، حسنا، إنهم تعرضوا للنهب في مجرتنا، ولكن في كل مرة وصلنا، كلهم هربوا."},
  [49] = {id=49,name="Alice",text="إذا تستطيع القبض عليهم، ولنا، ونحن يمكن أن تتعايش سلميا مع لكم."},
  [50] = {id=50,name="Justin",text="حسنا، ليس نهب لك فقط، بل أربعة نهب لدينا حصن بين النجوم الإنسان، والاستيلاء عليها من واجبنا، نحن سنهتم بهم."},
  [51] = {id=51,name="Jack",text="كنت الحملة اللعينة، لماذا دائما يطارد لنا للجري."},
  [52] = {id=52,name="Justin",text="أنتم هولاء القراصنة بين النجوم، يطوفون شوارع النهب والاتحاد قد أصدر مذكرات توقيف، وهذه المرة نحن هنا لمطاردة لك."},
  [53] = {id=53,name="Jack",text="هاها، مضحك، بوليس الكوكب لا يمكننا القيام بأي شيء، حتى انتم من البعثة الصغيرة."},
  [54] = {id=54,name="Justin",text="هل هذا صحيح؟ حاول لنرى ما اذا كنا نستطيع قبض عليك."},
  [55] = {id=55,name="Justin",text="انهم لا يعتقدون القتال ليست جيدة جدا، لكن يجري بسرعة."},
  [56] = {id=56,name="Noak",text="على الرغم أن سفن حربية عدم إطلاق النار شرسة جدا، ولكن كل ذلك من خلال تحسين مسرع، وتسارع سريع جدا، يمكنك التحرك بسرعة."},
  [57] = {id=57,name="Noak",text="حتى الرجال الطراد بين النجوم قد لا تكون قادرة على إلقاء القبض عليهم في محاولة لالقاء القبض عليهم يمكن أن يكون صعبا لبعض الشيء."},
  [58] = {id=58,name="Justin",text="وبعد ذلك يمكننا فقط نستخدم استراتيجية القبض على السلحفاة في زبدية ."},
  [59] = {id=59,name="Jack",text="كيف يكون لك، وما زالت باقيا حقا ."},
  [60] = {id=60,name="Justin",text="أربعة شر لكم، وأنا أقبض عليكم باسم العدالة."},
  [61] = {id=61,name="Jack",text="يقول السبر جدا، في الحقيقة، هي المنافقين فقط، وانتم لا يمكن التقاط لي على أية حال."},
  [62] = {id=62,name="Justin",text="حقا؟ هاها نشوف من يضحك في الأخير."},
  [63] = {id=63,name="Jack",text="مستحيل؟ لماذا تلحقون بنا؟"},
  [64] = {id=64,name="Justin",text="هاها، لن تهرب هذه المرة، لقد زرعت حول الساحة المجال المغناطيسي، وأنت تدخل مع دواسة البنزين."},
  [65] = {id=65,name="Jack",text="أنتم كيف تعرفون أني موجود هنا؟"},
  [66] = {id=66,name="Justin",text="كم مدى صعوبة هذا؟ هناك الكثير من الطاقة التي نحن نشر الأخبار، وانت تعرف الأخبار، لا تملك جنازة."},
  [67] = {id=67,name="Jack",text="هذه المرة فشلت في يديكم، ولكنك لم تكن سعيدا في وقت مبكر جدا."},
  [68] = {id=68,name="Justin",text="الكابتن جاك سلمته لك،  كيف الشيء الذي وعدت لنا؟"},
  [69] = {id=69,name="Alice",text="بعد ذلك يمكنك أن تستخرجوا في كوكب برج الحمل برج الحمل π المجرة، كشرط، يجب تقديم 50% من الطاقة بالنسبة لنا."},
  [70] = {id=70,name="Justin",text="لا مشكلة لعلنا نتعائش بشكل جيد."},
  [71] = {id=71,name="Alice",text="عليك أن تكون حذرا هنا، ولكن مكانا خطرا، في أي وقت ربما يكون قد حان لنهب الغزاة."},
  [72] = {id=72,name="Chuck Li",text="هناك هجوم العدو، هل هو لإنقاذ جاك؟"},
  [73] = {id=73,name="Jack",text="أوه، قلت لك لا تكون سعيدا في وقت مبكر جدا، كرويف، جئت في وقت متأخر آه قليلا."},
  [74] = {id=74,name="Cruyff",text="يا رفاق إثارة المتاعب، يأتي يحصل لي في ورطة، وهذا هو آخر مرة أقوم بانقاذ لكم."},
  [75] = {id=75,name="Justin",text="من أنتم؟ جاك مجرم مهم في النجوم ، ستكون مطلوبين لو تستمرون هكذا."},
  [76] = {id=76,name="Cruyff",text="تخويف من؟ ما هو الاتحاد؟ نحن لسنا خائفين من أي شخص المافيا الروسية."},
  [77] = {id=77,name="Justin",text="ماذا؟ أنتم فعلا الناس المافيا."},
  [78] = {id=78,name="Cruyff",text="كسلت أن أولي اهتماما لك، عد لديك محظوظا هذه المرة، ليس لدي شيء مهم، قد لا يكون محظوظا جدا في المرة القادمة."},
  [79] = {id=79,name="Alice",text="هم أشخاص أكثر من جاك  بغيضا، برج الثور المجرة التي تم التلاعب بها، إذا كنتم تريدين الذهاب إلى الثور المجرة، وتوخي الحذر."},
  [80] = {id=80,name="Justin",text="شكرا للذكر، كما لا تدخل إلى بيت النمرة، لا تقيض على ابن النمرة، وأود أن أذهب وأرى المجرات الثور، ما هذه المافيا القدرة."},
  [81] = {id=81,name="Justin",text="يا رئيس {1} القوات التعدين لديها كواكب في قاعدة التعدين الطاقة الحمل π المعمول بها، ونحن على استعداد للذهاب الى برج الثور المجرة!"},
  [82] = {id=82,name="1",text="سمعت أن المجرة المافيا الروسية الكبيرة في برج الثور، عليك أن تكون حذرا."},
  [83] = {id=83,name="Justin",text="كن مطمئن ، نحن نحذر!"},
  [84] = {id=84,name="Chuck Li",text="جاستن، الأمام هو الثور جاما الكوكب c، ونحن نستعد للهبوط عليه؟"},
  [85] = {id=85,name="Justin",text="يستعد للهبوط، والكامل استعداد للمعركة، ويقدر أن يكون شخص ما للترحيب بنا."},
  [86] = {id=86,name="Justin",text="أنا حقا لا اعتقد خطأ، ودخول حدودك، استقبلنا ترحيب حار ."},
  [87] = {id=87,name="Ansel",text="وقال كرويف أنك الأشرار، أليس كذلك؟"},
  [88] = {id=88,name="Christina",text="في هذه الأيام، كيف أن اللص يصيح لص، آه، فهي خطيئة لا تغتفر من الأشرار."},
  [89] = {id=89,name="Ansel",text="لا قادرة على تضليل الناس، كرويف يعامل معنا بشكل جيد في هذه الأيام، لمساعدتنا على الاستفادة من الطاقة، قدم لنا كعك لذيذ."},
  [90] = {id=90,name="Christina",text="اه، المجرة الثور الأصلية الأجانب يحبون الاكل، آه، أنا أرسلت البسكويت فقط ليقتنع بهم."},
  [91] = {id=91,name="Justin",text="من السهل أن نكذب السكان الأصليين الثور المجرات جيدة ، وهم موثوق بها أنها كرويف ولا يعتقد كلماتنا."},
  [92] = {id=92,name="Chuck Li",text="المشكلة هي أنها لا تزال قوية جدا، لا يعمل سواء في الطريقة القوية أم الينة، كيف يمكن هذا؟"},
  [93] = {id=93,name="Justin",text="أريد أن تغلب عليه، فقط لايجاد وسيلة لكرويف لإظهار الألوان الحقيقية، فقط تفرقهم لدينا فرصة للفوز."},
  [94] = {id=94,name="Barack",text="قائد أسطول دورية للكواكب باراك، ما هي الناس لك؟ لماذا الهجوم علينا فجأة؟"},
  [95] = {id=95,name="Justin",text="سوء الفهم، نحن بولاريس الحملة، والمجرة في اثني عشر مغامرة، أظن أنكم من اسطول كرويف."},
  [96] = {id=96,name="Barack",text="أوه؟ أنت تقول أن المافيا الروسية كرويف؟ تعرف أين هم؟"},
  [97] = {id=97,name="Justin",text="آه نعم، هو والقراصنة بين النجوم الكابتن جاك الثور يختبئون في المجرة."},
  [98] = {id=98,name="Barack",text="وهنا اثنان من المجرمين المطلوبين، هل أنت على استعداد لمساعدتي القبض عليهم؟"},
  [99] = {id=99,name="Justin",text="لكنهم حصل على دعم من المجرة الغريبة الثور، تريد الالتفات لهم، قليلا آه أكثر صعوبة. ما لم يكن انهيار التحالف بينهما."},
  [100] = {id=100,name="Barack",text="هذا سهل، دعونا نتظاهر بأن الهجوم الذي شنته القاعدة الثور المجرة، كرويف هو بالتأكيد لا يخرج المساعدات، ومن ثم كنت أعود المساعدة الثور المجرة."},
  [101] = {id=101,name="Justin",text="ولكن قوة المجرات الثور قوية، آه، قد لا تكون قادرة على استخراج كرويف."},
  [102] = {id=102,name="Barack",text="لا تقلق، تطلع إلينا."},
  [103] = {id=103,name="Ansel",text="لماذا يهاجموننا؟ نحن الثور المجرة السكان الأصليين آه المحبة للسلام."},
  [104] = {id=104,name="Barack",text="نحن أسطول دورية بين الكواكب، هو الاستيلاء على كرويف، تقدمها بطاعة."},
  [105] = {id=105,name="Ansel",text="كرويف هو صديقنا لن نقدمه أبدا."},
  [106] = {id=106,name="Barack",text="ثم يمكننا أن نكون أقوياء فقط، وتخضع للذهاب يموت."},
  [107] = {id=107,name="Ansel",text="هاها، كنت لا تعرف دينا هو قوي، يجرؤ في الواقع إلى يتوعد. هاه؟ عندي صداع، ماذا فعلت؟"},
  [108] = {id=108,name="Barack",text="نحن نعلم بالفعل نقاط ضعفك المجرات الثور، يمكن أن تتداخل في دماغك طالما أن الموجات المغناطيسية."},
  [109] = {id=109,name="Ansel",text="يا كرويف، انقذنا."},
  [110] = {id=110,name="Justin",text="قد كرويف هرب دعنا نساعدك."},
  [111] = {id=111,name="Ansel",text="شكرا لكم، سنكون في أزمنة لو لا تساعدنا."},
  [112] = {id=112,name="Justin",text="كنا نريد حقا أن يكون صديقا لك، ولكن فقط إولا اخرج كرويف الثور من المجرة، هل تعرف أين هم؟"},
  [113] = {id=113,name="Ansel",text="فقط في أوقات الأزمات عندما أرى من هم أصدقاء حقيقيين، وأيضا، كان في كوكب برج الثور l ، حيث يمكنك العثور عليها."},
  [114] = {id=114,name="Justin",text="شكرا ، بعد خروج كرويف نتحدث عن شأن التعاون."},
  [115] = {id=115,name="Justin",text="كرويف اختبأ كوكب برج الثور l، ونحن بسرعة الاستيلاء عليها الآن."},
  [116] = {id=116,name="Barack",text="نحن نستعد يمكن أن نهجموا في أي وقت"},
  [117] = {id=117,name="Justin",text="حسنا، خلع السفن الحربية، وابدأ الهجوم."},
  [118] = {id=118,name="Cruyff",text="لم اتوقع أن أخيرا فشلنا في يدكم."},
  [119] = {id=119,name="Barack",text="لك كل أنواع الشر في كل مكان، وقد أصدر الاتحاد بالفعل مذكرة اعتقال، نعود إلى المحاكمة في أسرع وقت ممكن معها."},
  [120] = {id=120,name="Cruyff",text="هاها، هل تعتقد أن اشتعلت لي على الخط حتى الآن؟ برمودا بالتأكيد لن تسمح لك التقاط لي، انتظر."},
  [121] = {id=121,name="Justin",text="ما هو برمودا؟"},
  [122] = {id=122,name="Cruyff",text="ها ها ها، ذلك الوقت سوف تعرف والمجرات زودياك لا تظن في غاية البساطة، سوف يندم عليه."},
  [123] = {id=123,name="Justin",text="شكرا علي مساعدتك، لقد نخرج كريف خارج كوكب برج الثور."},
  [124] = {id=124,name="Ansel",text="آه، يرحل، لا أحد لمساعدتنا على استغلال الطاقة، فإننا على الرغم من تكنولوجيا متقدمة جدا، لكنهم لا يعرفون شيئا عن التعدين."},
  [125] = {id=125,name="Justin",text="دعنا نساعد على استغلال الطاقة منها، التي يملكها التعدين مبلغ لك 50 في المئة، ما رأيك؟"},
  [126] = {id=126,name="Ansel",text="حقا؟ ومن شأن ذلك أن يكون كبيرا، قبل كرويف سوف تعطينا 10 في المئة فقط، أنتم جيدة حقا."},
  [127] = {id=127,name="Justin",text="أتمنى أن التعاون بينا نجاحا!"},
  [128] = {id=128,name="Chuck Li",text="سيئة، هناك شخص لمفاجأة. نحن بحاجة إلى عجلوا ضد."},
  [129] = {id=129,name="Justin",text="من أنتم لماذا تهجموننا؟"},
  [130] = {id=130,name="Clif",text="كنت يجرؤ على الذهاب ضد برمودا أيامك جيدة اقتربت من نهايتها."},
  [131] = {id=131,name="Justin",text="هل أنتم برمودا؟"},
  [132] = {id=132,name="Clif",text="برمودا هو لا تستطيع أن تسيء هذه القليل القلعة بين النجوم، واليوم فقط لتعطيك تحذيرا، بعد توقف فضولي."},
  [133] = {id=133,name="Justin",text="لا تذهب، اشرح جيدا!"},
  [134] = {id=134,name="Clif",text="تريد معرفة المزيد؟ تأتي إلى الجوزاء."},
  [135] = {id=135,name="Christina",text="حقا أن نذهب إلى الجوزاء؟ أنه أوضح أن فخ آه."},
  [136] = {id=136,name="Justin",text="وكانت مهمتنا دائما لاستكشاف كل مجرة البروج، حتى من دون هذه الحادثة، علينا أن نأتي إلى الجوزاء."},
  [137] = {id=137,name="Christina",text="ولكن لمجرد وجود أسباب برمودا، يجب علينا استكشاف ما إذا كانت خطوط الجوزاء التخلي عنه؟"},
  [138] = {id=138,name="Justin",text="وكان لدينا حملة لمواجهة الكثير من الصعوبات، ليس بسبب الصعوبات التي والتراجع، هيا، الأصدقاء."},
  [139] = {id=139,name="Christina",text="حسنا، يا القائد، ونحن نعمل يدا بيد معا."},
  [140] = {id=140,name="Jesco",text="من أنتم؟ من ثلاثة من مجموعة؟"},
  [141] = {id=141,name="Justin",text="نحن البعثة بولاريس، وليس مجموعة من ثلاثة، من أنتم؟"},
  [142] = {id=142,name="Jesco",text="أنا قائد الحملة أبابا بتلستر جي سيك، ولكن أيضا للمغامرة."},
  [143] = {id=143,name="Justin",text="ما هي التي قلت ثلاثة من المجموعة؟"},
  [144] = {id=144,name="Jesco",text="ثلاثة من مجموعة هي عصابات الأمة اليابانية، تلقينا للتو هجومهم، فقط للهروب من المصاعب."},
  [145] = {id=145,name="Justin",text="يبدو ان الجوزاء أيضا ليست السلمي، سافرنا معها."},
  [146] = {id=146,name="Jesco",text="الحمد لله."},
  [147] = {id=147,name="Jesco",text="أمام هذا الكوكب التوأم ζ، وآخر مرة ونحن هنا نصبوا كمينا ثلاث مجموعات."},
  [148] = {id=148,name="Justin",text="علينا أن نكون حذرين، الجوزاء خط أربعة مليئة جو غريب، والعدو في الظلام، ونحن في النور، ببطء إلى الأمام."},
  [149] = {id=149,name="Clif",text="التقينا مرة أخرى، قائد جوستين، لا أعتقد أن كنت حقا يجرؤ جاء نظام الجوزاء."},
  [150] = {id=150,name="Justin",text="هو أنت؟ برمودا؟"},
  [151] = {id=151,name="Jesco",text="وهو رئيس ثلاثة من مجموعات، وهذا هو، لقد أصابنا بهجومهم من قبل."},
  [152] = {id=152,name="Justin",text="من أنتم اصلا؟ ما هو برمودا؟"},
  [153] = {id=153,name="Clif",text="والآن قد دخلت الجوزاء، فإنه لا يحاول الخروج، وأنا مرافقتك للعب ببطء."},
  [154] = {id=154,name="Justin",text="يا جماعة احذروا، لقد تم نصب كمين لبعضهم البعض أربع مرات، وفي كل مرة يتعرضون للهجوم النهاية اختفى دون أن يترك أثرا."},
  [155] = {id=155,name="Jesco",text="الجوزاء هو غريب جدا، اختفى فجأة أسطول الآخر، كما لو كان من فراغ أن تختفي."},
  [156] = {id=156,name="Williams",text="أعتقد أنه يجب أن يكون هناك الثقب العنصر الثاني، عدو ئظهر سريعا أمامنا لمهاجمة لنا من خلال الثقب، ومن ثم من الثقب من الفرار."},
  [157] = {id=157,name="Jesco",text="والثقب العنصر الثاني؟ كيف نفعل ذلك؟ كيف يمكننا الهروب هجومهم؟"},
  [158] = {id=158,name="Williams",text="يا جماعة احذروا، لقد تم نصب كمين لبعضهم البعض أربع مرات، وفي كل مرة يتعرضون للهجوم النهاية اختفى دون أن يترك أثرا."},
  [159] = {id=159,name="Jesco",text="تحدير! ظهر اسطول العدو في الأمام."},
  [160] = {id=160,name="Jesco",text="هكذا ليست وسيلة ، والعدو يهاجمنا مرة أخرى ومرة أخرى، فإن أفضل طريقة هي أن تترك بسرعة نظام الجوزاء، أو لديك محوها."},
  [161] = {id=161,name="Justin",text="سحب من الجوزاء بشكل سريع هو طريقة واحدة، ولكن نحن الآن في قلب الجوزاء،  مثل الانسحاب ليس سهلا."},
  [162] = {id=162,name="Williams",text="لا داعي للذعر، فتحنا تحقيقا من التداخل الكهرومغناطيسي، وإذا كان هناك الثقب قريب، يمكن أن نجد."},
  [163] = {id=163,name="Williams",text="يمكننا اللحاق قبل أن الهجوم بنا باستخدام الثقب نقلها إلى مكان آخر."},
  [164] = {id=164,name="Jesco",text="لكننا لا نعرف من أين الثقب اتصال، إذا لم يذهب الى معقل العدو على الاستسلام ذلك؟"},
  [165] = {id=165,name="Justin",text="أي تغيير في التفكير، يمكننا كمين بالقرب من الثقب، والانتظار ليظهر العدو، وبعد ذلك هزيمة."},
  [166] = {id=166,name="Jesco",text="هذه فكرة رائعة، نفعل بها."},
  [167] = {id=167,name="Justin",text="أخيرا لقد اعتقلنك، لا تهرب هذه المرة!"},
  [168] = {id=168,name="Clif",text="لم أكن أتوقع، يمكنك أن تجد في الواقع الثقب هنا، وقمتم أيضا بالكمين مقدما."},
  [169] = {id=169,name="Justin",text="وهذا ما يسمى العين لشخص عين في جسده، وعلينا أيضا أن نقدم نصبوا كمينا بائسة، ولكن أيضا أقول لكم لتذوق طعم يجري الناس كمين."},
  [170] = {id=170,name="Clif",text="ثم نلقي نظرة لم يكن لديك هذه القدرة الآن."},
  [171] = {id=171,name="Clif",text="لم اتوقع لديك أيضا مثل هذه الفعالية القتالية العالية، ونحن في الواقع يمكن للفوز على أسطول نخبة من ثلاثة من مجموعة."},
  [172] = {id=172,name="Justin",text="تعاوننا حملتي الاكتشاف، وبطبيعة الحال لا يقهر، بطاعة اعتقل، وسوف أسلم لك على أسطول دورية بين الكواكب."},
  [173] = {id=173,name="Clif",text="يا الرجل الساذج، هل تعتقد أنها سوف تكون قادرة على التقاط لي؟ هنا، ونحن أكثر دراية مما كنت، وداعا."},
  [174] = {id=174,name="Jesco",text="لعنة، لم أتوقع أن يهرب، لا أعتقد أن هناك الثقب مخبأة في مكان قريب."},
  [175] = {id=175,name="Justin",text="لا بأس أثق بأن سنتقابل مرة أخري."},
  [176] = {id=176,name="Chuck Li",text="يا جاستن، دخلنا السرطان المجرة، سرطان c هو أمام الكوكب."},
  [177] = {id=177,name="Justin",text="منذ افترقنا مع وجي سيك ، طول الطريق هادئ، لم يعاد اللقاء، مجموعة من ثلاثة أشخاص."},
  [178] = {id=178,name="Chuck Li",text="آه نعم، ولكن الجو غريب جدا السرطان المجرة آه، يشعر على الإطلاق جو حزين."},
  [179] = {id=179,name="Justin",text="كما أنني شعرت بتظلمات الثقيلة هنا، علينا أن نكون حذرين."},
  [180] = {id=180,name="Justin",text="من أنتم؟ ولماذا أنتم هنا؟"},
  [181] = {id=181,name="Clarence",text="نحن نجم السرطان الناس، وأجيال تعيش في المجرة السرطان."},
  [182] = {id=182,name="Justin",text="انتم ناس من السرطان نجمة، لماذا انتم بالحرج ذلك؟"},
  [183] = {id=183,name="Clarence",text="لدينا رئيس عشيرتنا موريس وهو مسحن، لدينا قبيلة يمكن أن تسمح فقط موريس أرسلت في هذه الطاقة الحفر."},
  [184] = {id=184,name="Justin",text="لا تخف، نساعدك على نقذ رئيس عشيرتك."},
  [185] = {id=185,name="Chuck Li",text="السرطان هو النجم أمام الناس المسجونين السرطان البطريرك ζ الكوكب، أربعة يخضع لحراسة مشددة للغاية، لانقاذ بهدوء الصعب جدا البطريرك آه."},
  [186] = {id=186,name="Justin",text="حسنا، اغلب بالذكاء فحسب، أو سهلة لإثارة شكوكه."},
  [187] = {id=187,name="Chuck Li",text="كيف نفعل؟"},
  [188] = {id=188,name="Justin",text="يمكننا أن ندعي فقط أن يأتي إلى جمع الحملة، والصراع مع بعضها البعض يحدث، ثم العمل يصرف الرئيسي الآخر مرة أخرى."},
  [189] = {id=189,name="Chuck Li",text="هذا افتراح، نفعل به!"},
  [190] = {id=190,name="Justin",text="لم أكن أتوقع حراس العدو حراسة ذلك،  في الواقع هناك الكثير من الحراس في قاعدة."},
  [191] = {id=191,name="Chuck Li",text="وهذا هو ما يجب القيام به؟ فشل الإجراء الأخير، كان العدو يقظة."},
  [192] = {id=192,name="Justin",text="طريقة لينة ليست مفيدة يجب اتخاذ طريقة قوية، وأول من ترك هنا مرة أخرى، ثم استدعي إلى أسطول دورية بين الكواكب."},
  [193] = {id=193,name="Justin",text="بارك أخيرا أتيت، نواجه شئا معقدا ممكن تساعدنا؟"},
  [194] = {id=194,name="Barack",text="أي شيء معقد؟ قل لي."},
  [195] = {id=195,name="Justin",text="رئيس العشيرة للسرطان مسجن بموريس والنجوم السرطان الذين أصبحوا عبده."},
  [196] = {id=196,name="Barack",text="موريس، هل هو تاجر مخدرات ماليس، لم أستطيع العثور عليه لفترة طويلة، لا أعتقد يختبئ هنا، وهذه المرة معنا قبض عليه."},
  [197] = {id=197,name="Chuck Li",text="القبطان، هناك العديد من سفن العدو يحيط بنا."},
  [198] = {id=198,name="Barack",text="يأتي بالضبط، أولا اشتعلت التوابع الصغيرة، ونطلب من جميع أنحاء في الوضع القول."},
  [199] = {id=199,name="Barack",text="موريس هو مكان للاختباء الأمامي. نحن مسؤولون عن معظم الأحوال، من هو المسؤول عن التواطؤ، وعدم السماح لهم الفرار."},
  [200] = {id=200,name="Justin",text="لا مشكلة، من المفروض أن ننقذ رئيس العشيرة وتحرير ناس السرطان."},
  [201] = {id=201,name="Maurice",text="لم اتوقع أنتم موجودين بارك كيف انت هنا؟"},
  [202] = {id=202,name="Barack",text="لقد تم أبحث عنك لفترة طويلة، لا أعتقد أنك يختبئون هنا، وهذا حقا الحصول عليك بلا جهد."},
  [203] = {id=203,name="Maurice",text="حسنا، هل تعتقد بحيث يمكننا أن نفعل شيئا لي، رئيس العشيرة لا يزال في يدي، صفقة كبيرة للخروج من يموت السمك."},
  [204] = {id=204,name="Barack",text="إياك والتسرع!"},
  [205] = {id=205,name="Maurice",text="اسمحوا لي بسرعة يفسح الطريق للخروج ... أو أنا قتل رئيس العشيرة."},
  [206] = {id=206,name="Justin",text="للأسف، وهذا أعطاه تشغيل. لحسن الحظ، الحمد للهتم انقاذ رئيس العشيرة في نهاية المطاف."},
  [207] = {id=207,name="Barack",text="كن مطمئن، لن يهرب."},
  [208] = {id=208,name="Barack",text="أنا ركبت على متن السفن موريس تعقب، كان يختبئ هنا، وهذا سوف تكون قادرة للقبض عليه."},
  [209] = {id=209,name="Justin",text="جيدة حقا، وهذه المرة ومن المؤكد أن قبض عليه."},
  [210] = {id=210,name="Clarence",text="شكرا لكم، إن كنت ينقذنا نجمة السرطان الناس، سوف تكون دائما أصدقائنا."},
  [211] = {id=211,name="Justin",text="عفوا."},
  [212] = {id=212,name="Clarence",text="سرطان المجرة قبل ضيفنا نرحب دائما لكم، واستخرجوا الطاقة الخاصة بك كما تشاء."},
  [213] = {id=213,name="Justin",text="ومن شأن ذلك أن يكون خيرا، بعد كل شيء، رجل طيب مكافأة."}
}
return DStory